import React, { useEffect, useState } from 'react'
import Homepage from './HomePage';
import { useParams } from 'react-router-dom';
import axios from 'axios'

const Quizzes = () => {
    const fetchclassroomDetails = async () => {
        const { code } = useParams()
        const [classroom, setClassrooms] = useState([])


        try {
            const response = await axios.get(`http://localhost:8000/quizzes/${code}`)
            console.log(response)
            setClassrooms(response.data.classrooms.quiz)
        }
        catch (error) {
            console.log(error)
        }

    }
    useEffect(() => {
        fetchclassroomDetails()
    }, [])


    return (
        <>
            <Homepage showPlusIcon={false} />
            {classroom.length > 0 ? (
                classroom.map(classroom => (
                    <div className="w-full p-4">
                        <div className="bg-white p-4 rounded-lg shadow-lg">
                            <div className="mt-4">
                                <div className="mb-4">
                                    <div className="flex items-center space-x-3">
                                        <div className="text-orange-500">
                                            &#128196;
                                        </div>
                                        <div>
                                            <p className="font-bold">JavaLab-A1,A3,B2</p>
                                            <p className="text-sm text-zinc-600">SEITB (July-Dec 2022)</p>
                                            <p className="text-xs text-zinc-500">Posted Wednesday, Aug 17, 2022</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
            
        ))):(
            <h1>Hello world</h1>
        )}
        </>
    )
}

export default Quizzes
